      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 86 IN ( - col1 * - col2, - 32, - + ( col1 ), col0 / + + col2 + - col1, - 6 + + + 56, - col0 );
  - name: tab1

outputs:
  - name: q5094.out
    data: |
      51	14	96
      85	5	59
      91	47	68
